CREATE procedure [dbo].[spGetTaxFormByID] 
(
@id int
) 
as  
begin  
SELECT 
p.TaxPayerNumber,
t.*,
netincomeroundedyes=ISNULL((select 
sum(convert( decimal(20,2), (case when field20 = '' then 0 else convert(decimal(20,2), REPLACE(field20,',','')) end))) as field20
from IEIncome 
where form=t.type
and year=t.year
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='yes'), 0),

netincomeroundednot=ISNULL((select 
sum(convert( decimal(20,2), (case when field20 = '' then 0 else convert(decimal(20,2), REPLACE(field20,',','')) end))) as field20
from IEIncome 
where form=t.type 
and year=t.year 
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='no'), 0),

bonusroundedyes=ISNULL((select 
sum(convert( decimal(20,2), (case when field15 = '' then 0 else convert(decimal(20,2), REPLACE(field15,',','')) end))) as field15
from IEIncome 
where form=t.type
and year=t.year 
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='yes'), 0),

bonusroundednot=ISNULL((select 
sum(convert( decimal(20,2), (case when field15 = '' then 0 else convert(decimal(20,2), REPLACE(field15,',','')) end))) as field15
from IEIncome 
where form=t.type
and year=t.year 
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='no'), 0),

totalperiodroundedyes=ISNULL((select 
sum(convert( decimal(20,2), (case when field3 = '' then 0 else convert(decimal(20,2), REPLACE(field3,',','')) end))) as field3
from IEIncome 
where form=t.type
and year=t.year 
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='yes'), 0),

totalperiodroundednot=ISNULL((select 
sum(convert( decimal(20,2), (case when field3 = '' then 0 else convert(decimal(20,2), REPLACE(field3,',','')) end))) as field3
from IEIncome 
where form=t.type
and year=t.year 
and TaxPlayerNumber=p.TaxPayerNumber
and ammend=t.ammend
and field8='no'), 0)

FROM 
TaxForm t
JOIN TaxPlayerDetails p ON p.TaxRefNo=t.taxidnumber
WHERE t.id=@id
end 






