CREATE procedure [dbo].[spGetIncomeByCountry] 
(
@type int,
@TaxPlayerNumber varchar(50),
@form varchar(50),
@year varchar(50),
@ammend int
) 
as  
begin  
select  
o.country, 
sum(case when o.incomecurrency !='' then convert( decimal(20,2), REPLACE(o.incomecurrency,',','')) else 0 end ) as incomecurrency, 
sum(case when o.taxpaidcurrency !='' then convert( decimal(20,2), REPLACE(o.taxpaidcurrency,',','')) else 0 end) as taxpaidcurrency, 
sum(case when o.incomerp !='' then convert( decimal(20,2), REPLACE(o.incomerp,',','')) else 0 end) as incomerp, 
sum(case when o.taxpaidrp !='' then convert( decimal(20,2), REPLACE(o.taxpaidrp,',','')) else 0 end) as taxpaidrp, 
sum(case when o.ftc !='' then convert( decimal(20,2), REPLACE(o.ftc,',','')) else 0 end) as ftc, 
sum(case when o.allowedftc !='' then convert( decimal(20,2), REPLACE(o.allowedftc,',','')) else 0 end) as allowedftc
from Overseas_Income o
where o.TaxPlayerNumber=@TaxPlayerNumber 
and o.type=@type 
and o.form=@form 
and o.year=@year 
and o.ammend=@ammend
group by o.country
end 


