CREATE procedure [dbo].[spGetExchRate] 
(
@currency varchar(50),
@interval varchar(50),
@type int, 
@year varchar(50)
) 
as  
begin  
	if(@type=1)
	begin
		SELECT data.currency, data.amount
		FROM (SELECT
			currency,
			SUBSTRING(LEFT(interval,CHARINDEX('-',interval)-1), 7,4) + '-' + 
			SUBSTRING(LEFT(interval,CHARINDEX('-',interval)-1), 4,2) + '-' + 
			SUBSTRING(LEFT(interval,CHARINDEX('-',interval)-1), 1,2) as startdate,
			SUBSTRING(RIGHT(interval,CHARINDEX('-',interval)-1), 7,4) + '-' + 
			SUBSTRING(RIGHT(interval,CHARINDEX('-',interval)-1), 4,2) + '-' + 
			SUBSTRING(RIGHT(interval,CHARINDEX('-',interval)-1), 1,2) as enddate,
			amount
		FROM Exchange
		WHERE type=@type and currency=@currency and year=@year ) AS data
		WHERE DATEDIFF(s, '1970-01-01 00:00:00', @interval) BETWEEN  DATEDIFF(s, '1970-01-01 00:00:00', data.startdate)
		and DATEDIFF(s, '1970-01-01 00:00:00', data.enddate)
	end
	else
	begin
		SELECT data.currency, data.amount
		FROM Exchange as data
		WHERE type=@type 
		and currency=@currency
		and interval=@interval
		and year=@year
	end
end 


